import React, {Component} from "react";
import logo from '../statics/images/logo_4.png';

class Header extends Component{
    render(){
        return(
              <nav className="navbar navbar-expand-lg navbar-dark bg-dark shadow-sm">
                <div className="container">
                    <a className="navbar-brand masterheader--a" href="#">
                        <h1 className="mastheader--h1"><img src={ logo } alt="Tzed tech" className="mastheader--img"/></h1>
                    </a>
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse masterheader__navbar--div" id="navbarNavAltMarkup">
                        <div class="navbar-nav">
                            <a class="nav-item nav-link active" href="#">Home</a>
                            <a class="nav-item nav-link" href="#">Encode</a>
                            <a class="nav-item nav-link" href="#">Decode</a>
                            <a class="nav-item nav-link" href="#">API</a>
                        </div>
                    </div>
                </div>
            </nav>
        );
    }
}
export default Header;
